svg.script:
   
	var myMapApp = new mapApp(false,undefined);//与tooltip相关
	var obc;//
	var ocls;
	window.onSVGLoad=initLater();
	function initLater() {
     //this timeout is because of the bbox bug in Firefox which prevents to have access to bbox in onload scripts
    	//	window.setTimeout("init1()",0);

     	window.setTimeout("init2()",3000);
		window.setTimeout("init2()",7000);
		window.setTimeout("init2()",10000);
    }
	
	function init2() {
		  
	    /* 添加tooltip*/
        //tooltip styles
         var tooltipTextStyles = {"font-family":"Arial,Helvetica","fill":"dimgray","font-size":1300};
         var tooltipRectStyles = {"fill":"white","stroke":"dimgray"};
         myMapApp.initTooltips("toolTip",tooltipTextStyles,tooltipRectStyles,10,20,3);
         //add tooltip to element
		 myMapApp.addTooltip("legend",undefined,true,false,"target","name");
		 myMapApp.addTooltip("zta",undefined,true,false,"target","name");
		
	}
function closeinfotip(n)
	{
	document.getElementById('infotip'+n).setAttribute("style", "visibility: hidden"); 
	}

	function Closeleone(){
	    
		 document.getElementById('cir2_1').setAttribute("style", "visibility: hidden");
	     document.getElementById('cir2_2').setAttribute("style", "visibility: hidden");
	     document.getElementById('cir2_3').setAttribute("style", "visibility: hidden");
		 document.getElementById('a1').setAttribute("style", "visibility: hidden");
	     document.getElementById('a2').setAttribute("style", "visibility: hidden");
	     document.getElementById('a3').setAttribute("style", "visibility: hidden");
		
	}
	function Closeletwo(n){
	     
		 document.getElementById("cir2_" + n).setAttribute("style", "visibility: visible");
		 document.getElementById("a" + n).setAttribute("style", "visibility: visible");
	}
	function Hightlight(evt) {
         var object = evt.target;
         var cls = object.id;
         var objectMap = document.getElementById("map"+cls);
		 ocls = objectMap.getAttribute("class") || object.className;
         objectMap.setAttribute("class","fil100");
   }
   function Recover(evt) {
         var object = evt.target;
		 var cls = object.id;
         var objectMap = document.getElementById("map"+cls);
		 objectMap.setAttribute("class",ocls);
	}
	   function Hght(evt) {
         var object = evt.target;
         var cls = object.id;
		 for(var i=1;i<4;i++){
         var objectMap = document.getElementById("map"+cls+i);
		 ocls = objectMap.getAttribute("class") || object.className;
         objectMap.setAttribute("class","fil100");
		 }
   }
   function Rver(evt) {
         var object = evt.target;
		 var cls = object.id;
          for(var i=1;i<4;i++){
         var objectMap = document.getElementById("map"+cls+i);
		
        objectMap.setAttribute("class",ocls);
		 }
		 
	}
